import './../Style/History.css';
import { useState, useEffect } from "react";
import {variables} from "../Variables";

function AppHistory(){
    const [order, setOrder] = useState(null);
    const [shop, setShop] = useState(null);

    useEffect(() => {
        fetch(variables.API_URL+"get_order_user/"+localStorage.getItem("id"), {
            method: "GET",
            headers: {
                'Accept': 'application/json, text/plain',
                'Content-Type': 'application/json;charset=UTF-8'
            },
            })
            .then(response => response.json())
            .then(result => {
                console.log(result)
                setOrder(result)
            }
        )
    }, []);

    return(
    <div className="history">
        <h1>User Service History</h1>
        <div className='history-table'>
            <table>
                <thead>
                    <tr>
                        <th>Deatils</th>
                        <th>Date Time</th>
                        <th>Status</th>
                        <th>To Review</th>
                    </tr>
                </thead>
                    
                <tbody>
                    {order !== null?
                    order.map((item, index) => {
                        {console.log(item)}
                        <tr key={item.id}>
                            <td>
                                {item.id}
                            </td>
                            <td>
                                {item.create_time}
                            </td>
                            <td>
                                {item.status}
                            </td>
                            <td>
                                -
                            </td>
                        </tr>
                    })
                    :'2'}
                </tbody>
            </table>
        </div>
    </div>
    );

}

export default AppHistory;
